description:
This is a bot for the site Astunn.com, a site very similar to VineFire.com
It is most likely a scam but it is a very good way to get clicks on your paid links or drive traffic to your sites.

*It will submit your links every 2 minutes (Astunn has a 2 minute wait time)
*While its waiting between posts it will click on links, to make you money that you will most likely never see.


